# Dulan, Republic of Buryatia

}}
Dulan (; , Dulaan) is a rural locality (a selo) in Kabansky District, Republic of Buryatia, Russia. The population was 132 as of 2010. There are 9 streets.
Geography
Dulan is located 69&nbsp;km north of Kabansk (the district's administrative centre) by road. Oymur is the nearest rural locality.
